verse: LUK.014.006
translations:
  kpx-kpx: Kateai louge kosive keau hotove ibina louveve humahau uoholinu.
  okv-H: enana ke mine ari inono ae ea.
  tbo-tbo: Tamogi geka a bahana ega ipa hina wimiheya.
  mal-C: അവർക്കതിന് ഉത്തരമൊന്നും പറയാൻ കഴിഞ്ഞില്ല.
  grc-SR: Καὶ οὐκ ἴσχυσαν ἀνταποκριθῆναι ⸋αὐτῷ⸌ πρὸς ταῦτα.
  bgc-bgc: वे इन बात्तां का कुछ जवाब कोनी दे पाए।
  khz-khz: Na Iesu ira na ati gevega-geleato.
  deu-TKW: Und sie vermochten darauf nichts zu erwidern.
  zsr-NT: Cutu bi didzaꞌ guc lubiꞌë ca nac lë ni.
  lin-lin: Bakokaki te kopesa Ye eyano.
  hns-NT: Ie baat par oesab koetjh na bol paais.
  noa-E: Mamʉ ich iek ʉ̈khamkhĩir par irua mag jëeu ohookhamjã ni ãbmuajã i iek ʉ̈khabajim
    anaabá.
  eng-EMTV: And they were not able to answer Him regarding these things.
  mib-NT: Te tu ní cúu stíó cuɨ́ñɨ́ de ni ɨɨn jnūhun nuū yā jeē súcuan ni cahān yā.
  lif-NT2: कर खे़ङ्‌हाॽरे़ थेआङ् नोगप् पिमा मे़न्‍छुक्‍तुन्‍लो॥
  xnj-xnj: Nambu vene nakuhotola kumyangula.
  mmx-mmx: Ketla di goxo epovo xusu dina vorang levelinga ren.
  cbr-NT: Ësoquin ñucácëxunbi ca cáma 'icën.
  tee-NT: Pus ju yu'unch jantu lai tu'u' ixtamapusp'itni ju ani chivinti.
  eng-LSV: And they were not able to answer Him again to these things.
  cak-NT: Y ri maestros y ri fariseos man xquiwil ta anchique xqui'ij-apo che ri Jesús.
  pah-NT: Nonhi'ĩpondekwavi g̃a. A'ereki g̃a g̃wenohẽ tuhẽ sábado rupi.
  sja-NT: Mamĩda maarepida p'anauda-e paji.
  xed-xed: Triɗ, traptra həŋ ta skwi ŋa zlghanaftá wani.
  mks-NT: Joo co̱ó na̱cuu nducú ñehe na tu̱hun nu̱ Jesús.
  gfk-S: Sene be pa di gale tange tike linge.
  bmu-bmu: Mewö qesim eŋgii miaŋgö likepŋi meleŋbingö lömböriba numbuŋini muhungöba
    bök tatket. Mewö.
  dgz-dgz: Nop ame anune go garewa wapen menan umap uon, menan no uon di wanumon.
  eng-GNV: And they could not answere him againe to those things.
  zaa-NT: Làcą nna labí betseláni cą biỹa ecàbini cą ne.
  eng-WEBSTER: And they could not answer him again to these things.
  guh-guh: Nexata bajarapamonae acuenebi pejumecanaviatsijava Jesúsjavabelia.
  bon-bon: Siige, teepi äblicäco nuuja mene teebine jaji.
  nhw-BL: Huan inijuanti amo tleno quinanquilijque.
  mgw-mgw: Nabembe baakombwili kunnyangwa lyaalalwiye.
  swh-ONEN: Nao hawakuwa na la kusema.
  wbi-wbi: aveene valyale vasila ngufu isakwamula ghano ghano vavaposisie.
  bba-bba: Yerɑ bɑ kpɑnɑ bu ɡɑri yi wisi.
  eng-KJVCPB: And they could not answer him again to these things.
  kgk-NT: Ohendu-ma ramo upéa nhe'ẽ, ndikatúi ojohu vai.
  waj-waj: tuduu rikiada iya hama yopeema inna kuaivaa sai tiravai.
  ekk-PKP: Nad ei suutnud vastust anda.
  mpx-mpx: He i ba ola o, yaka nige bosowailiya anana nihi lahe.
  wbp-wbp: Kujalu yapangku purda-nyangu Jijajiji wangkanja-kurra nyampu-kurra, ngulajulu
    wurulypa-jarrija. Lawa, kulalurla nyarrpalku nyanungukuju nginji-wangkayarla.
  luo-luo: To ne gionge gima digiwachi.
  nhe-NT: Huan inijuanti ax tleno quinanquilijque.
  aii-aii: ܘܠܵܐ ܡܨܹܐ ܠܗܘܿܢ ܓ̰ܲܘܸܒܝܼ ܐܸܠܹܗ ܒܘܼܬ ܐܵܗܵܐ.
  esk-NT: Aglaan kiggutiksraiññiġaat.
  msb-msb: Wara gihapon sin nakasabat sani sa inda.
  cpa-NT: Jøng² ha¹chi² ma²ŋi¹² dsa² héi² he² jǿg³ ŋai¹dsa jin³ he².
  dso-dso: ଏତର୍‌ ମିସା ସେମନ୍‌ ଏ କାତାର୍‌ ଉତର୍‌ ଦେଇ ନାପାର୍‌ଲାଇ ।
  meu-meu: Idia ese ia asie haere henia diba.
  yva-NT: Weramu vatane wato wo ayao inta rasakinav akananto kakai, yara umanin bayave.
  dgc-dgc: Ey to pégkagi ni Jesus ta éya, éy éwan side tu katuwiran diya.
  zpm-NT: Loxaque lo zho rac, ib bdzield zho pe nquiab zho.
  hix-NT: Noro yoyukhura nehxatxkon hatà.
  sim-sim: Karem or mbarik lir mbeek mashi las mbakurik nari ambu lir.
  npi-ULB: तिनीहरूले ती कुराहरूको जवाफ दिन सकेनन् ।
  cgc-cgc: Pagtapos ta ambal Jesus, ula danen an gasasaba tak igo ambal din an.
  tim-tim: Hain dâm makyeŋgimbo hâuŋe bo magaŋmâ hanyeŋeâk aŋun aŋgim tali.
  yor-yor: Wọn kò sì lè dá a lóhùn mọ́ sí nǹkan wọ̀nyí.
  wos-wos: Wungi wandéka di déka hundi hasa wanjoka di hurufatiké.
  emp-NTPO: Baribʌrʌ ãdjirãba ni cãrẽ sid̶a panunaẽ́ basía.
  eng-F35: And they could not answer Him regarding these things.
  ind-ind: Dan tidak ada seorang pun di antara mereka yang sanggup membantah pernyataan
    Yesus itu.
  pes-OPCB: اما ایشان جوابی نداشتند که بدهند.
  mpt-mpt: inanea wafu ombianea utlamabobe. Olo bain bleka dim eso ge baabesea i tekein
    keniba e wengo bain kesoa i mo yang keim blim kesiobe.
  ssx-ssx: Koto leekepate mo haliwekima꞉ta꞉ Yesuna꞉ pi hombo peapeketa꞉ ana꞉ na piekeme.
  mkl-mkl: Ŋɔi ɑ kù yɔkɔ ɑ kù jɛɑɑ ideu.
  gaq-gaq: ଦର୍ମସାସ୍ତ୍ରି ଆରି ପାରୁସିଇଙ୍ଗ୍ ଆକେନ୍ ସାପା ସାମୁଆଁନେ ମେଃଡିଗ୍‌ ବାଲିର୍ ଆୟାଆର୍‌କେ
    ଣ୍ତୁ ।
  gof-RNT: Entti issibaakka zaaranaw dandda7ibookkona.
  unx-unx: ଆଡଃ ଇନ୍‌କୁ ନେ ସବେନ୍‌ କାଜିନାଙ୍ଗ୍‌ ଇନିଃକେ କାକ କାଜିରୁହାଡ଼୍‌ ଦାଡ଼ିୟାନା ।
  gah-gah: Loko lokago, anotó aliki li amemisá amó.
  lcm-lcm: Na parik kipa angkoai si polpol ani mengen ke.
  aer-aer: Nhenge tyerrtye areyele awerrirreme Jesus alakenhe angkerlenge, itne nterte
    anerrirreke. Itne itelarerrirretyakenhe iwenhe ikwere-akerte akurnentye angkerrirretyeke.
  qvc-NT: Chaymi chay farisiyukunaqa manana nimatapis atirqanllapachu kuntistayta.
  tgl-ULB: Hindi sila nakapagbigay ng sagot sa mga bagay na ito.
  cbs-NT: jatu xabakabi chiteawen taea jawa yuiamabumaken
  xtm-NTPP: Te ñatuu ka ni'i ini de nawa jin ndakone'e de.
  nnq-nnq: Angweto baotolingije kunnyanga.
  bao-NT: Jesús to biro cʉ̃ ca ĩiro, cʉ̃ja pea do biro cʉ̃re ĩi yʉʉ majitiupa.
  san-ORI: ତତସ୍ତେ କଥାଯା ଏତସ୍ୟାଃ କିମପି ପ୍ରତିୱକ୍ତୁଂ ନ ଶେକୁଃ|
  rmn-rmn: Лэнги ништо на сас тэ пхэнэн адалэски.
  huv-NT: Nejiw ngondom mangochiw masajüw nej nicuajind.
  otn-NT: Hi̱nte ga̱ nda̱tho'ʉ yø ja̱'i̱ nzofo.
  nop-nop: Unduŋ yeniŋguk kaŋ mede tubu-udanedok lohi tiŋa hogok ikiŋ.
  obo-NT: Piru waa en sikandan nokotavak.
  kca-kca: Пӑ ԓыв щит пеԓа Ԓўвеԓа йŏхԓы йастәты ӑт верәтсәт.
  cak-ENT: Y ri etamanela' chin ri ley ri xuya' ri Dios richin ri Moisés y ri fariseos
    man xquil tüj c'a achique xquibij-apu chin ri Jesús.
  lif-NT: ᤁᤖ ᤂᤧᤱᤜᤠ᤹ᤖᤧ ᤌᤣᤀᤠᤱ ᤏᤥᤃᤵ ᤐᤡᤔᤠ ᤔᤧᤴᤇᤢᤰᤋᤢᤴᤗᤥ॥
  mie-NT: De nduú ní ncúu scócóo ndá dē ni iin tūhun nūū yā jā súcuán nī ncāhān yā.
  san-TIB: ཏཏསྟེ ཀཐཱཡཱ ཨེཏསྱཱཿ ཀིམཔི པྲཏིཝཀྟུཾ ན ཤེཀུཿ།
  qve-NT: Ichaqa mayqenninkupas manan ni imaynatapas contestayta atirankuchu.
  pao-NT: Umu Pharisee gi hanotoosoo ha'yoo unne-wa'ne'yoo.
  cbu-NT: Parísiypanshuchsha yámarangeeja, manga.
  usa-usa: yemá min-áíkáqá kanaaráq yauwéqma ítiraae.
  soy-soy: Api rinɔ́ɔ piyɔ́ɔ́ u pɔɔnɛ.
  hui-hui: Ani layagola tigua ladai bibe nahe hene.
  amf-amf: Dhalqin ogosa malsin maasana kedi damadehe.
  quc-NNT: Man xkiriq tä k'ut jas xkib'ij che.
  dob-dob: Ta taudi tuga nigeya ꞌebweu wate ꞌidi eꞌisamo.
  wrs-wrs: No Varisinindva himba owai, eva es Yesusmba moamba opla vrimnita, owainonoa.
  mca-mca: Qa nite'ƚe weju'ƚiju'ƚ pekhewe'en qu' nekuƚik'i aka'an.
  kiw-kiw: Irai rii-ro, modobo bia ruu madei omoaimai.
  tzo-TZC: Pero muꞌyuc xtacꞌ yuꞌunic jbeluc.
  mya-mya: သို့​ရာ​တွင်​သူ​တို့​သည်​အ​ဘယ်​သို့​မျှ​အ​ဖြေ မ​ပေး​တတ်​ကြ။
  gng-NT: Nɛ ba fre' ki jiin' wɔ uʼniire nnɔ.
  cbi-NTPO: Tsenñu yala naati' pakan tsandyala.
  ikk-NT: Kanị, asanị wẹ ẹka za ihiẹn ọwụlẹ.
  leu-leu: Taasaxa ri nai xanakuut.
  maz-NT: Anguezeji dya mi pãrãji ja rvá ndünrüji.
  bod-N: དེ་རྣམས་ཀྱིས་ལན་འདེབས་མ་ནུས༌སོ།།
  tca-NT: Rü nümagü rü taxuü̃maãma nanangãxü̃gü.
  zpl-NT: Pero lecaxi ullela arquiꞌbeella acuaqui beella lunu.
  mbc-NT: Mîrîrî yuuku to'ya eserîke pra awanî'pî.
  ndg-ndg: Bembe babi ni uwezo kwaa wa pia jibu kewa mambo ago.
  wsk-wsk: Bare nuna den mu koma balmonko iwita mena.
  toj-NT: Jaxa yenlei mi ni jun palabra ma' sama stii.
  tbc-tbc: Ak man ta kisaek ru naon ipei man tia ya.
  sna-sna: Ipapo vakashayiwa chokureva.
  smk-NT: Ket kai sara nin naka'bat konan tepet na.
  grc-TCGNT: Καὶ οὐκ ἴσχυσαν ἀνταποκριθῆναι αὐτῷ πρὸς ταῦτα.
  gof-WFTW: Entti issibaakka zaaranaw dandda7ibookkona.
  spa-BLM: No pudieron responderle sobre estas cosas.
  kyz-NT: A'ere 'gã noje'egi futari ajemogyau ojeupe 'ga 'eramũ.
  dao-dao: Acunüng, acuna ngthu cun am msang thei u lü awmki he.
  cya-cya: Una a ngujlyo ti' ne' ña'an xcuen ne' 'in ñi lo'o cha' can'.
  nii-nii: Pe wumb en enim eim nim ek ei ni orung kindnenjing.
  ign-NT: Énasera vahi napatsi­ca­vahini najica­pahini. Timati­na­na­richucha.
  dik-NT: Ku wɛ̈t kënë acï ke nyɔ̈ŋ nhïïm kë bëër kek ye.
  cac-cac: Majxo nachajlaj tas syutej eb' vin̈ spacan d'ay.
  tzj-E: Per j-e' nmajo'n xecney ta cmal nak necbij tzra.
  san-BUR: တတသ္တေ ကထာယာ ဧတသျား ကိမပိ ပြတိဝက္တုံ န ၑေကုး၊
  yaa-NT: tsõa kemanima.
  cab-NT: Maríñagun jáña ni cáta.
  clu-clu: Piro ara ra gid may nagsabat kanana sa anang pamangkot nga dia.
  swh-ULB: Wao hawakuwa na uwezo wa kutoa jibu kwa mambo haya.
  tpt-NT: Ex yuꞌuncha jantu lay tuꞌuchun katanaunchoqol.
  aai-aai: Sabuw baiyafutinamih hikasiy hima kwanekwan.
  sny-sny: Lowe werese peri lo itiya'u te'e ta'ame.
  myy-myy: Ito ĩ yija tʉocõri, no bajiro cʉdi masibisijarã ĩna.
  trc-NT: Veé dan me se a̱ ꞌó nana̱ ne quiri̱i̱ nij soꞌ caꞌmi̱i̱ nij soꞌ rihaan Jesucristó
    maꞌ.
  cut-NT: Ate hua chi ndahconan sa̱hn chahn nde a̱ma ndudo.
  bel-bel: І не маглі запярэчыць яму на гэта.
  zlm-KSZI: Mereka tidak dapat memberikan jawapan tentang perkara itu.
  gdr-gdr: Sɨ ton makwa rɨrɨr na auto mɨra yɨt opulitam.
  vmy-NT: ꞌBa nchjabiu bi kitsingojore, ngatꞌa bi be jó= kuetsu.
  cmn-FEB: 众人无法回答这个问题。
  gmv-RNT: Istika oyshas aykko zaaroka demmanas dandayibetenna
  ncl-NT: Huan momajtiloaya pa quinanquililosquiaya Jesús.
  sua-sua: Ta mnganang ngar tok, vanangko ngat her gia vongnek kim kat.
  klt-klt: Wáina yánuk, enendu watá topmá kámá ma inánáyan.
  are-are: Etnantama yarna angkitjikerraka.
  gai-gai: Ri, mina mana kam ruti, mbopna mɨnna wanaiŋ.
  qvm-NT: Tsaynog niptin manami imatapis rimacärergantsu.
  chz-NTPS: Niꜙ ja̱a̱ˉ saꜙ gaꜙlɨhꜗ maˊ je̱e̱yhꜙ juuˈ kihꜗ Jesús.
  kmu-kmu: HamavigegeꞋya mukiꞋa vayaꞋmoya kenonaꞋa kea ohuꞋya mainae.
  ood-NT: Kush pi hedai e nako mas has wo chei.
  lbm-lbm: हि यो बातों को कुछ उत्तर नहीं दे सक्यो।
  ncj-NT: Huan ahhuel tlen otenanquilihque.
  yuj-yuj: Aerá séránko maok, am fárákap te nopok maomp kar pwarokwaprá sér mwarap
    pourou mono.
  kto-kto: Pa tale kan puomeng meba mepulang urie ties.
  gmv-NT: ኢስቲካ ኦይሻስ ኣይኮ ዛሮካ ዴማናስ ዳንዳዪቤቴና
  por-BLT: Eles não foram capazes de responder a Jesus.
  stp-NT: Baꞌ guiꞌ bhaiꞌ pɨx xi ñɨiꞌñ am, na guꞌ cham bhaaiꞌ nam jax jaꞌk jup xi chɨɨdaꞌ.
  ame-NT: Ñetñapaʼ ama errot̃enayeʼ otenayeʼ enteñeto amaʼt eʼñe puesheñarrot̃a.
  mgh-2016: Attu ayo khayoonrie umwaakhulha ittu.
  kvn-NT: Tenal Judio-tummagan Jesús-kwen-abin-imaszhulmal, ilgwen yakir pesmal.
  gvf-gvf: Dimba yalin kobe ka maan dinamba, pire unin si milungwa.
  san-ISO: tatastē kathāyā ētasyāḥ kimapi prativaktuṁ na śēkuḥ|
  deu-ELBBK: Und sie vermochten nicht, ihm darauf zu antworten.
  mcb-NT: Tyampatyo inkantaigeri, teratyo iriniimaige maani.
  yle-yle: Yesu ka u kópu daangmê vya ngópu, dêê dniye.
  swh-1850: Nao hawakuweza kumjibu swali hilo.
  msc-msc: Alu ma se Isa jabila.
  ese-NT: Paniseo dejja cuana jjashahuabaquiequi jjejojo, mimi jjima nequia cua.
  jac-NT: Yaj xin maẍticꞌa yu istakꞌwi ebnaj yin̈ tzet yal Comam.
  cak-CNT: Y ri etamanela' y ri fariseos man xquil ta c'a achique xquibij-apo chire
    ri Jesús.
  zia-zia: Ayero senu awong ge abena sao awiya teng oko yero ge aung yewa.
  mal-2015: വലിച്ചെടുക്കയില്ലയോ എന്നു ചോദിച്ചതിന്നു പ്രത്യുത്തരം പറവാൻ അവർക്കു കഴിഞ്ഞില്ല.
  tuo-NT: Cʉ̃ tojo nisere ne yʉꞌtitiyʉꞌrʉocãꞌcãrã niwã.
  mbl-NT: Ha' xutigãhã', tu hãm'ãktux yũmmũg 'ohnãg.
  zpc-NT: Naꞌra bira ubinyaquëꞌ bi yëbiyaquëꞌ lëbëꞌ.
  gul-NT: Dem leada ain been able fa say nottin ginst wa Jedus tell um.
  arp-arp: Nau haeeyauhuune nesenehethauthee jea nuu hayauhuhau.
  mau-NT: Li²coi³ coan³-le⁴ nca³ qui³nchja⁴ je² cjoa⁴-vi⁴.
  gup-gup: Dja bedda minj baleh birriyimeninj birriwokmayi, birriwokyawarrinj.
  bss-NT: Boŋ bénkênwóŋgé dyamdyam âhɔ́b.
  met-met: Baing haruangading te.
  nys-nys: Yalga baalap yoowart kayar-yalman-waangki baalany.
  kpj-NT: Tiiboho rirawyonyõhyyre.
  zao-NT: Ne neeka thib zha ngogt gakab lo Jesús.
  byx-byx: Dai be quasik mager ip te virliit luqia ama lengiqi.
  ctu-CTI: Pero jini fariseojob mach'an ti mejli i saj jac'beñob i t'an.
  zos-NT: Y ni jujchena'ṉ ja mus 'yaṉdzo'ṉoyaj Jesusis chamuse.
  gvs-gvs: Go ina livala pasidi tauyadi sopadi ikaupatudi.
  kbm-kbm: Bemem eisir gitangi ebe ve inwel Yisu avo be inei yaun ti nipil gen etok
    ok ite beti tumi-ngge imbweg.
  tew-tew: Hebo háawin wên wänbo wíḏínhanginnáhpí óetu̖ˀa̖míḏí.
  rmc-rmc: A on leske pre oda na džanle te odphenel.
  apr-apr: Ngan le tirau toko betanga ki pitiap yege.
  tiy-tiy: Endob ménantés ro non énda i éntingayén késumbul ro de.
  nlg-nlg: Ma gaira tara mua tangomana ge kara bosa tughua na huahuati keri.
  dgr-DOGNT: Hagòhdı t'à agııdì whìle.
  pes-OPV: پس در این امور از جواب وی عاجزماندند.
  ron-1924: Ши н-ау путут сэ-Й рэспундэ нимик ла ачесте ворбе.
  tpz-tpz: Ivëhkëk, ee to hikta onöt ne a piun a soe pamëh.
  agd-agd: Máa sen ina íkan betí ankan ída mana vaya sen mino.
